script: |
  super -f text -I q3345.spq | sort > q3345.out

inputs:
  - name: q3345.spq
    data: |
      SELECT col1 + col1 AS col1 FROM tab1 (FORMAT parquet) WHERE NULL NOT BETWEEN - col0 * + col2 * - - col1 - - 49 * CAST ( NULL AS INTEGER ) AND - col2;
  - name: tab1

outputs:
  - name: q3345.out
    data: |
